import classNames from "classnames"
import { nanoid } from "nanoid"
import styles from "./styles.module.css"

export const TableHeader = ({headers}) => {
    return headers.map(el => (<th
    key={nanoid()}
    className={classNames(
      styles.table_cell,
      styles.table_cell__header
    )}>
    {el}
  </th>))
}
